import { Component } from 'react'
import AMap from './config'

var map,marker;

export default class Map extends Component {
    componentDidMount(){

        map= new AMap.Map('map',{
            center:[111.38059, 35.625949],
            zoom:10
        })

        marker= new AMap.Marker({
            position:[111.38059, 35.625949],
            title:'村里'
        })

        map.add(marker)
    }



    render(){
        return null
    }
}

export { map,marker }
